import './App.css';
import HookUseEffect from './hooks/HookUseEffect';
import HookUseRef from './hooks/HookUseRef';
import HookUseState from './hooks/HookUseState';

function App() {
  return (
    <div className="App">

      <HookUseState/>
      <hr/>
      <HookUseEffect/>
      <hr />
      <HookUseRef/>
    </div>
  );
}

export default App;
